import React, { Component } from "react";
import Home from "./pages/Home";

class App extends Component {
  constructor(props) {
    super(props);
    this.setPage.bind(this);

    this.state = {
      page: null,
    };
  }

  componentDidMount() {
    this.setPage(<Home setPage={this.setPage} />);
  }

  setPage(page) {
    super.setState({ page: page });
  }

  render() {
    return this.state.page;
  }
}

export default App;
